class Solution {
public:
    int makeTheIntegerZero(int num1, int num2) {
        int operations = 0;
        while (num1 != 0) {
            if (operations > 60) return -1; // If more than 60 operations required, return -1
            long long power = 1;
            for (int i = 0; i <= 60; ++i) {
                if ((power << i) > abs(num1 - num2)) {
                    num1 -= (power << (i-1)) + num2;
                    operations++;
                    break;
                }
            }
        }
        return operations;
    }
};
